/* For use with .NET Script Framework: SkyrimSE - ArranzCNL
	Contains all imagebase / function addresses used throughout the project for easier maintainability when SkyrimSE updates.

	Notes:
	I tried to use descriptive names with everything however I couldn't workout some, so they contain NAME_1, NAME_2, etc.

	I used double quotation ( ""HEX"" ) for the more specific address being captured, rest are the full function block. If you see ( "|"HEX"|" ) from 1_5_73 it denotes changes from 1_5_62 notably [DAT_ADDRESS].
	There are 26 Unresolved hex addresses which isn't bad considering there are 600+ game addresses in total, however it messes up attempting the UNIVERSAL approach.
	
	More than likely best to just dump all addresses into an external file and load from there, least if there is an update don't need to keep rebuilding the project.
		SkyrimSE_1_5_80_addresses.ini - when checking version can work out the ini file it is loading or even state if it is missing. Would make it backward/forward compatible with each SkyrimSE update then.
*/
